import React, { Component } from 'react'

export default class TUserCard extends Component {
    render() {
       return (
  
      <li className="list-group-item text-capitalize d-flex justify-content-between my-2">
         <img src={this.props.user.image} alt={this.props.username} />
         <h4>{this.props.name}</h4>
         <h6>{this.props.username}</h6>
                 
         <div className="todo-icon">
             <span className="mx-2 text-success" onClick={this.props.handleEdit}>
                 <i className="fas fa-pen"></i>
             </span>
             <span className="mx-2 text-danger" onClick={this.props.handleDelete} >
                 <i className="fas fa-trash" ></i>
             </span>
         </div>
      </li>

       )}
  }
